import React from 'react';

const NextPage = () => {
  return (
    <div className="flex justify-center items-center h-screen">
      {/* Left Section */}
      <div className="w-1/2">
        <img src="/weight.jpg" alt="Your Image" className="w-full" />
      </div>
      {/* Right Section */}
      <div className="w-1/2 px-8">
        <h1 className="text-4xl font-bold mb-4">You're in the right place</h1>
        <p className="text-lg text-gray-600 mb-6">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer adipiscing erat eget risus sollicitudin pellentesque et non erat.</p>
      </div>

    </div>
  );
};

export default NextPage;
